import styled from "styled-components";

export default {
  Container: styled.div`
    padding: 30px 120px;
    width: 100%;
  `,
  Form: {
    Container: styled.form`
      padding: 17px 28px;
      display: flex;
      flex-direction: column;
    `,
    TitleInput: styled.input`
      margin-bottom: 10px;
      background: rgba(0, 0, 0, 0.07);
      opacity: 0.6;
      border-radius: 8px;
    `,
    DescriptionInput: styled.textarea``,
  },
};
